import { StatusBar } from 'expo-status-bar';
import { StyleSheet, Text, View,ScrollView } from 'react-native';
import { NavigationContainer } from '@react-navigation/native';
import Navbar from './src/components/Navbar/Navbar';
import {createNativeStackNavigator} from '@react-navigation/native-stack';
import MarketplaceScreen from './src/screens/Marketplace/MarketplaceSreen';
import Login from './src/screens/Authentication/LoginScreen';
import SignUp from './src/screens/Authentication/Signup';
import Payment from './src/screens/Payment/PaymentScreen';
import PaymentSuccessful from './src/screens/Payment/PaymentSuccessful';
import paymentMethod from './src/screens/Payment/paymentMethod';

export default function App() {
  return (

    <NavigationContainer>
    
    <paymentMethod/>
    
    </NavigationContainer>

  );
}
